    <Banner>
      <div className={style.aboutMe}>
        <Heading heading='About Me' />
        <p>Lorem ipsum dolor sit amet consectetur adipisicing elit. Quibusdam aspernatur vero omnis necessitatibus dolorem saepe eum molestias nemo quidem ipsa doloremque commodi dolorum incidunt debitis, accusamus fugit molestiae consectetur obcaecati!</p>
      </div>
    </Banner>
  );
}
